    <div className="item item-1">
        <img src={`${process.env.PUBLIC_URL}../../assets/global/shape-1.png`} ></img>

      <div>
        <p>ПРИВЕТ,</p>
        <h1>ЭТО НЕ КОММЕРЧЕСКОЕ ЗАДАНИЕ</h1>
      </div>

      <button>Что дальше?</button>

      <img src={shape} className="Shape_1"></img>
    </div>
  );
}
